import React, { Component } from 'react'
import "./About.css"
import aboutImage from "./Images/mika-baumeister-dMNee_epAnw-unsplash.jpg"


export default class About extends Component {
    render() {
        return (
            <div className='about'>
                <div className='about__container'>
                <div className='about__image'>
                    <img className='about__img' src={aboutImage}></img>
                </div>
                <div className='about__texts'>

                </div>
                   
                </div>
            </div>
        )
    }
}
